    def __check(self, result, nrows, ncols):
        self.assertIsInstance(result, GeoDataFrame, "Is a GeoDataFrame")
        self.assertEqual(nrows, len(result), "Count rows")
        self.assertEqual(ncols, len(result.columns), "Count columns")
        self.assertTrue(result.timestamp.is_monotonic_increasing, "Test timestamps")
        self.assertTrue(result.curv_absc.is_monotonic_increasing, "Test curvilinear abscissa (1)")
        self.assertTrue(result.curv_absc.is_unique, "Test curvilinear abscissa (2)")
        self.assertEqual(0, result.loc[0, "curv_absc"], "Test curvilinear abscissa (3)")
        self.assertEqual(1.0, result.loc[len(result) - 1, "curv_absc"], "Test curvilinear abscissa (4)")

